import '../shared.css';

const DataUsagePrivacy: React.FC = () => {
  return (
    <div>
      <h2>Data Usage and Privacy</h2>
      <p>
        We are committed to protecting your privacy and ensuring the security of your data. By submitting an audio clip, you acknowledge and agree that the clip will be temporarily stored in a secure Amazon S3 bucket for the sole purpose of processing and analysis by our model. Please refrain from including any personally identifiable information (PII) in your submission, as we cannot be held responsible for any data that may inadvertently contain such information.
      </p>
    </div>
  );
};

export default DataUsagePrivacy;
